-- View structure for horario_estudiante_v
-- ----------------------------
DROP VIEW IF EXISTS `horario_estudiante_v`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `horario_estudiante_v` AS select `a`.`idestudiante` AS `idestudiante`,`b`.`idciclo` AS `idciclo`,`b`.`num_semestre` AS `num_semestre`,`b`.`idmateria` AS `idmateria`,`c`.`desc_materia` AS `desc_materia`,`c`.`cve_materia` AS `cve_materia`,`b`.`desc_grupo_corto` AS `desc_grupo_corto`,`b`.`aula` AS `aula`,`a`.`idopcion_curso` AS `idopcion_curso`,case when `a`.`idopcion_curso` = 2 then 'R' when `a`.`idopcion_curso` = 3 then 'E' end AS `desc_opcion_curso_corto`,`c`.`creditos` AS `creditos`,`b`.`lunes` AS `lunes`,`b`.`martes` AS `martes`,`b`.`miercoles` AS `miercoles`,`b`.`jueves` AS `jueves`,`b`.`viernes` AS `viernes`,`b`.`sabado` AS `sabado`,concat(`d`.`nombre_profesor`,' ',`d`.`apaterno`,' ',`d`.`amaterno`) AS `profesor`,`a`.`idgrupo` AS `idgrupo` from (((`grupos_estudiantes` `a` join `grupos` `b`) join `cat_materias` `c`) join `profesores` `d`) where `a`.`idgrupo` = `b`.`idgrupo` and `b`.`idmateria` = `c`.`idmateria` and `b`.`idprofesor` = `d`.`idprofesor`;

